import QueryStatsIcon from '@mui/icons-material/QueryStats';

const Widget = (type) => {
  return (
    <div className="widget">
         <div className="left">
          <span className="title">users</span>
          <span className="counter">21312</span>

          </div>
         <div className="right">
          <QueryStatsIcon/>
         </div>
    </div>
  )
}

export default Widget
